webpackJsonp([30,423],{86:function(e,s){e.exports="data:image/png;base64,"},1487:function(e,s,l){e.exports={frontmatter:l(504),content:l(2659)}},2659:function(e,s,l){e.exports="<section class=intro id=introdusjon> <h1 class=intro id=introdusjon>Introdusjon:</h1> <p>Her skal vi lage dataspillet Ping pong. Vi skal også lære om å hvordan du kan få programmene dine til å reagere på tastetrykk. Dette er veldig nyttig når du skal lage spill.</p> </section> <section class=activity id=steg-1-sprettende-ball> <h1 class=activity id=steg-1-sprettende-ball>Steg 1: Sprettende ball</h1> <p>Vår begynnelse kommer til å ligne på det vi gjorde i <a href=../sprettende_ball/sprettende_ball.html>den sprettende ballen</a>.</p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Start Processing og skriv dette:</label></p> <pre><code class=processing><span class=hljs-built_in>float</span> ballX;\n<span class=hljs-built_in>float</span> ballY;\n<span class=hljs-built_in>float</span> ballXFart = <span class=hljs-number>2</span>;\n<span class=hljs-built_in>float</span> ballYFart = <span class=hljs-number>2</span>;\n<span class=hljs-built_in>float</span> ballRadius = <span class=hljs-number>9</span>;\n<span class=hljs-built_in>float</span> ballDiameter = ballRadius * <span class=hljs-number>2</span>;\n\n<span class=hljs-keyword>void</span> <span class=hljs-title>setup</span>() {\n  <span class=hljs-built_in>size</span>(<span class=hljs-number>600</span>, <span class=hljs-number>300</span>);\n\n  ballX = <span class=hljs-built_in>width</span> / <span class=hljs-number>2</span>;\n  ballY = <span class=hljs-built_in>height</span> / <span class=hljs-number>2</span>;\n}\n\n<span class=hljs-keyword>void</span> <span class=hljs-title>draw</span>() {\n  ballX = ballX + ballXFart;\n  ballY = ballY + ballYFart;\n\n  <span class=hljs-keyword>if</span> (ballX &lt; ballRadius) {\n  ballXFart = -ballXFart;\n  }\n  <span class=hljs-keyword>if</span> (ballX &gt; <span class=hljs-built_in>width</span> - ballRadius) {\n  ballXFart = -ballXFart;\n  }\n  <span class=hljs-keyword>if</span> (ballY &lt; ballRadius) {\n  ballYFart = -ballYFart;\n  }\n  <span class=hljs-keyword>if</span> (ballY &gt; <span class=hljs-built_in>height</span> - ballRadius) {\n  ballYFart = -ballYFart;\n  }\n\n  <span class=hljs-built_in>background</span>(<span class=hljs-number>0</span>);\n  <span class=hljs-built_in>ellipse</span>(ballX, ballY, ballDiameter, ballDiameter);\n}\n</code></pre> <p>Koden er endret litt fra oppgaven om den sprettende ballen. Vi bruker andre navn på variablene våre. Det er også noen helt nye variabler.</p> <p>Hvorfor tror du vi har gjort dette?</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Kjør programmet ved å trykke på <strong>Ctrl + R</strong> eller knappen <img src="+l(86)+' alt="" title="Play - En knapp i verktøylinjen merket med pil"></label></p> </li> </ul> <figure><img src='+l(3382)+' alt="" title="En sprettende ball på en svart bakgrunn."></figure> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_2><label for=cbx_2> Lagre programmet som PingPong ved å trykke på <strong>Ctrl+S</strong> eller velg <strong>File --&gt; Save</strong> i menyen.</label></li> </ul> </section> <section class=try id=utfordringer> <h2 class=try id=utfordringer>Utfordringer</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_3><label for=cbx_3> Kan du endre størrelsen på ballen?</label></li> <li class=task-list-item><input type=checkbox id=cbx_4><label for=cbx_4> Kan du endre farten til ballen?</label></li> </ul> </section> </section> <section class=activity id=steg-2-ballen-faller-bak> <h1 class=activity id=steg-2-ballen-faller-bak>Steg 2: Ballen faller bak</h1> <p>I Ping pong skal du hindre at ballen faller bak rekkerten. For at det skal være vits å gjøre dette må vi først sørge for at ballen ikke bare spretter tilbake når den treffer venstre vegg. Vi kan begynne med å sørge for at ballen ikke spretter tilbake.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Fjern koden som gjør at ballen spretter tilbake (denne ligger i den øverste ‘if’-en), slik at du går fra dette:</label></p> <pre><code class=processing><span class=hljs-keyword>if</span> (ballX &lt; ballRadius) {\n  ballXFart = -ballXFart;\n}\n</code></pre> <p>Til:</p> <pre><code class=processing><span class=hljs-keyword>if</span> (ballX &lt; ballRadius) {\n\n}\n</code></pre> <figure><img src='+l(3380)+' alt="" title="En ball går igjennom venstre vegg"></figure> </li> </ul> <section class=try id=utfordringer-2> <h2 class=try id=utfordringer-2>Utfordringer</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_6><label for=cbx_6> Kan du få ballen til å dukke opp et annet sted etter den har gått igjennom veggen?</label></li> </ul> </section> </section> <section class=activity id=steg-3-legg-til-rekkerten> <h1 class=activity id=steg-3-legg-til-rekkerten>Steg 3: Legg til rekkerten</h1> <p>Nå som ballen kan falle igjennom den venstre veggen, så må vi få på plass en rekkert, slik at du kan slå ballen tilbake. Det gjør vi ved å ha noen tallvariabler som representerer hvor rekkerten er og hvor stor den er. I tilegg så må vi ha kode som sender ballen tilbake.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Legge inn disse variablene nedenfor de som er der fra før:</label></p> <pre><code class=processing><span class=hljs-built_in>float</span> rekkertHoyde = <span class=hljs-number>66</span>;\n<span class=hljs-built_in>float</span> rekkertBredde = <span class=hljs-number>5</span>;\n<span class=hljs-built_in>float</span> rekkert1X = <span class=hljs-number>20</span>;\n<span class=hljs-built_in>float</span> rekkert1Y = <span class=hljs-number>100</span>;\n</code></pre> <p>Disse variablene skal vi bruke til å holde styr på på størrelsen og plasseringen til rekkerten.</p> <p>Rett nedenfor background(0), legg til dette:</p> <pre><code class=processing><span class=hljs-built_in>rect</span>(rekkert1X, rekkert1Y, rekkertBredde, rekkertHoyde);\n</code></pre> <figure><img src='+l(3378)+' alt="" title="En ball går igjennom rekkerten"></figure> <p>Vi kan nå se rekkerten når vi kjører programmet, men ballen går igjennom rekkerten. Det er fordi vi ikke har skrevet kode som stopper ballen og sender den tilbake.</p> <p>Legg til følgende i draw()-funksjonen:</p> <pre><code class=processing><span class=hljs-keyword>if</span> (ballX-ballRadius &lt; rekkert1X + rekkertBredde &amp;&amp; ballX + ballRadius &gt; rekkert1X) {\n  <span class=hljs-keyword>if</span> (ballY &lt; rekkert1Y + rekkertHoyde &amp;&amp; ballY &gt; rekkert1Y) {\n    ballX = ballX + rekkertBredde;\n    ballXFart = -ballXFart;\n  }\n}\n</code></pre> </li> </ul> <figure><img src='+l(3383)+' alt="" title="Ballen spretter på rekkerten"></figure> <section class=try id=utfordringer-3> <h2 class=try id=utfordringer-3>Utfordringer</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_8><label for=cbx_8> Kan du gjøre rekkerten mindre?</label></li> <li class=task-list-item><input type=checkbox id=cbx_9><label for=cbx_9> Kan du endre plasseringen til rekkerten?</label></li> </ul> </section> <section class=protip id=forklaring> <h2 class=protip id=forklaring>Forklaring</h2> <p>Her er et bilde som forklarer hva de forskjellige variablene står for:</p> <figure><img src='+l(3381)+' alt="" title="Illustrasjon som viser sammenhengen mellom variablene og hva tingene i spillet"></figure> </section> </section> <section id=steg-4-styre-rekkerten> <h1 id=steg-4-styre-rekkerten>Steg 4: Styre rekkerten</h1> <p>Vi har en rekkert, men den er ikke til mye hjelp så lenge du ikke kan styre den. Derfor må du skrive kode som gjør at du kan styre den.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Skriv inn følgende i draw():</label></p> <pre><code class=processing><span class=hljs-keyword>if</span> (<span class=hljs-built_in>keyPressed</span>) {\n  <span class=hljs-keyword>if</span> (<span class=hljs-built_in>keyCode</span> == UP) {\n    rekkert1Y = rekkert1Y - <span class=hljs-number>2</span>;\n  }\n  <span class=hljs-keyword>if</span> (<span class=hljs-built_in>keyCode</span> == DOWN) {\n    rekkert1Y = rekkert1Y + <span class=hljs-number>2</span>;\n  }\n}\n</code></pre> <p>Denne koden sjekker først om en knapp er trykket ned (keyPressed). Deretter sjekker den om det er opp- eller ned-knappen som blir trykket ned, og beveger rekkerten basert på dette.</p> </li> </ul> <figure><img src='+l(3379)+' alt="" title="Rekkert som beveger seg"></figure> <p>Nå har du laget Ping pong!</p> <section class=protip id=bokstavtaster> <h2 class=protip id=bokstavtaster>Bokstavtaster</h2> <p>Hvis du vil styre ved å trykke på bokstavtaster istedenfor piltastene, må du endre litt på koden. Mange er vant til å styre opp med <strong>W</strong> og ned med <strong>S</strong>.</p> <p>Hvis du endrer:</p> <pre><code class=processing>  <span class=hljs-keyword>if</span> (<span class=hljs-built_in>keyCode</span> == UP) {\n</code></pre> <p>Til:</p> <pre><code class=processing>  <span class=hljs-keyword>if</span> (<span class=hljs-built_in>key</span> == <span class=hljs-string>\'w\'</span>) {\n</code></pre> <p>kan du styre opp med <strong>W</strong>. Hva tror du at du må gjøre for å kunne styre ned med <strong>S</strong>?</p> </section> <section class=try id=utfordringer-4> <h2 class=try id=utfordringer-4>Utfordringer</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_11><label for=cbx_11> Kan du endre farten rekkerten beveger seg i?</label></li> <li class=task-list-item><input type=checkbox id=cbx_12><label for=cbx_12> Kan du legge til en rekkert på den andre siden slik at to spillere kan spille mot hverandre?</label></li> <li class=task-list-item><input type=checkbox id=cbx_13><label for=cbx_13> Kan du gjøre det slik at ballens vertikale retning (opp og ned) bestemmes av hvilken del av rekkerten den treffer?</label></li> <li class=task-list-item><input type=checkbox id=cbx_14><label for=cbx_14> Kan du gjøre noe som gjør at spillet blir vanskeligere etter hvert? For eksempel at ballen går raskere og raskere etter hvert, eller at rakkerten blir mindre.</label></li> </ul> </section> </section> '},3378:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/ballGjennomRekkert.1a4f7a.gif"},3379:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/bevegeligRekkert.0628d4.gif"},3380:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/gjennommaal.c81f36.gif"},3381:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/illustrasjon.192830.png"},3382:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/sprettendeBall.0cade1.gif"},3383:function(e,s,l){e.exports=l.p+"_/oppgaver/src/processing/pingpong/spretterPaRekkert.60edb8.gif"}});